import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };

  names(){
    return (
      this.user
    )
  }
  render(){
    return (
      <table style={{display:"flex"}}>

        <tr style={{color:"black",fontSize:"15px",flexDirection:"column",marginLeft:"10px"}}>
          <th>Nomes</th>
          <th>Data de Nascimento</th>
          <th>Genero</th>
          <th>Info</th>
          <th>Titulo</th>
          <th>Endere√ßo</th>
          <th>Salario</th>
        </tr>

        <tr style={{color:"black",fontSize:"15px"}}> 
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_birth_date)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_gender)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_gender)}</td>
          <td style={{color:"black",fontSize:"12px"}}>{this.myUserList.map(user=>user.user_address_id)}</td>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px",display:"table-column-group"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
        </tr>

      </table>
    )
  };

}


export default Table;
